import React, { useEffect } from 'react'

export default function EffectHookCancelDemo() {
  useEffect(() => {
    console.log("订阅一些事件");

    return (() => {
      console.log("取消事件订阅");
    })
  })

  return (
    <div>
      <h2>EffectHookCancelDemo</h2>
    </div>
  )
}
